import React from 'react'

function NameList() {

  const users = [{
  name: 'Danil',
  age: 18,
  id: 1  
  } ,
  {
  name: 'Nurik',
  age: 18,
  id: 2 
  } 
]
 

  return (
    <div>
    {
       users.map(user => <h1 key={user}>{user.name} {user.age} {user.id}</h1>) 
    }
    </div>
  )
}

export default NameList
